#[cfg(test)]
mod tests {

    use dashu_float::{Context, round::mode::Zero};
    use dashu_macros::{dbig, ibig};
    use rustedbytes_pi::compute_pi;

    fn get_pi_digits() -> String {
        include_str!("pi_digits.txt").to_string()
    }

    #[test]
    fn test_one_million_digits() {
        let digits = 192_000;
        let p = compute_pi(digits);

        println!("len {}", p.to_string().len());

        assert_eq!(p.to_string().len(), digits as usize + 2);

        for (i, c) in p.to_string().chars().enumerate() {
            let p = get_pi_digits().chars().nth(i).unwrap();
            assert_eq!(c, p, "Mismatch at index {}", i);
        }
    }

    #[test]
    fn test_binary_split_1_2() {
        let (pab, qab, rab) = rustedbytes_pi::binary_split(1, 2);
        assert_eq!(pab.to_string(), "-5");
        assert_eq!(qab.to_string(), "10939058860032000");
        assert_eq!(rab.to_string(), "-2793657715");
    }

    #[test]
    fn test_binary_split_1_3() {
        let (pab, qab, rab) = rustedbytes_pi::binary_split(1, 3);
        assert_eq!(pab.to_string(), "1155");
        assert_eq!(qab.to_string(), "957304069945956794936328192000000");
        assert_eq!(rab.to_string(), "-244479889433338740603253065");
    }

    #[test]
    fn test_binary_split_2_3() {
        let (pab, qab, rab) = rustedbytes_pi::binary_split(2, 3);
        assert_eq!(pab.to_string(), "-231");
        assert_eq!(qab.to_string(), "87512470880256000");
        assert_eq!(rab.to_string(), "-254994357387");
    }

    #[test]
    fn test_binary_split_1_4() {
        let (pab, qab, rab) = rustedbytes_pi::binary_split(1, 4);
        assert_eq!(pab.to_string(), "-1276275");
        assert_eq!(
            qab.to_string(),
            "282744150338349327484720295874090277797888000000000"
        );
        assert_eq!(
            rab.to_string(),
            "-72208257316346012928456348682766762497244025"
        );
    }

    #[test]
    fn test_binary_split_1_5() {
        let (pab, qab, rab) = rustedbytes_pi::binary_split(1, 5);
        assert_eq!(pab.to_string(), "3904125225");
        assert_eq!(
            qab.to_string(),
            "197949113784380161370086287723699183824180409892941594624000000000000"
        );
        assert_eq!(
            rab.to_string(),
            "-50552984125686101746228994534091499889077848307882335805887375"
        );
    }

    #[test]
    fn test_chudnovsky_105() {
        let (_p1n, q1n, r1n) = rustedbytes_pi::binary_split(1, 105);

        let context = Context::<Zero>::new(105);
        let q = context.sqrt(dbig!(10005).repr()).value();

        let n = ibig!(426880) * &q * &q1n;
        let d = ibig!(13591409) * &q1n + &r1n;

        assert_eq!(
            n.to_string(),
            "5.28101498099143760297674733589311855156665728788591469964933776330310752694890608267941984482464713471674E+2173"
        );
        assert_eq!(
            d.to_string(),
            ""
        );
    }

    #[test]
    fn test_binary_split_1_1005() {
        let (pab, qab, rab) = rustedbytes_pi::binary_split(1, 1005);
        assert_eq!(
            pab.to_string(),
            ""
        );
        assert_eq!(
            qab.to_string(),
            ""
        );
        assert_eq!(
            rab.to_string(),
            "-"
        );
    }
}
